import React, { useState } from "react";
import { Link } from "react-router-dom";
import * as Icons from "react-icons/fa";
import Dropdown from "../Dropdown/Dropdown";
import img from '../../../Asserts/Logos/building.png';

function navItems() {
  const navItem = [
    {
      id: 1,
      title: "Home",
      path: "./",
      cName: "nav-item",
      image:img,
    },
    {
      id: 2,
      title: "Services",
      path: "./services",
      cName: "nav-item",
      image:img,
    },
    {
      id: 3,
      title: "Products",
      path: "./products",
      cName: "nav-item",
      image:img,
    },
    {
      id: 4,
      title: "Contact Us",
      path: "./contactus",
      cName: "nav-item",
      image:img,
    },
  ];
  const Listt=navItem.map((item) => { 
    return (
      <li key={item.id} className={item.cName}>
  
  <img src={item.image} style={{display: 'flex',marginBottom:"30px",marginRight:'50px',


  height: '60px',width:'90px'}}/>
</li>
    );
  })

  return (
    <>
      <nav className="navbar">
      
        <ul className="nav-items">
        {Listt}
        </ul>
      
      </nav>
    </>
  );
}


export default navItems;
